import produce from "immer";

const initailState = {
  imgs: [],
  //
  st_listRequest: false,
  st_listDone: false,
  st_listError: null,
};

const reducer = (state = initailState, action) =>
  produce(state, (draft) => {
    switch (action.type) {
      default:
        break;
    }
  });

export default reducer;
